INSERT INTO `cryptocurrencydevelopers` VALUES (1,'Satoshi Nakamoto','https://bitcoin.org/','Bitcoin is a decentralized digital currency that operates without the need for a central authority or intermediary. Transactions are verified by network nodes through cryptography and recorded in a public distributed ledger called a blockchain. The cryptocurrency was invented in 2008 by an unknown entity under the name Satoshi Nakamoto. Bitcoin is often described as a cryptocurrency, a virtual currency, or a digital currency. It is designed to act as money and a form of payment outside the control of any one person, group, or entity, thus removing the need for intermediaries like banks or governments.',1),(2,'Vitalik Buterin','https://ethereum.org/',NULL,1),(3,'Ripple Labs','https://ripple.com/xrp/',NULL,1),(4,'Josh Fraser and Matthew Liu','https://www.originprotocol.com/',NULL,1),(5,'Tony Cui','https://achain-exchange.com/',NULL,1),(6,'Brock Pierce, Reeve Collins, and Craig Sellars','https://tether.to/en/',NULL,1),(7,'Changpeng Zhao','https://www.binance.com/en/research/projects/bnb',NULL,1);
/*!40000 ALTER TABLE `cryptocurrencydevelopers` ENABLE KEYS */;
